 Deep in the mountain lives a beautiful young man, Bau. He is a faithful woodcutter who makes rice wine deep in the field. &quot;God of the mountain I would like to have a good companion&quot;, he prayed and prayed. But, the only things that came back were the tracks of the deer that destroyed his precious field! One day, Bau found an unconscious yet fascinating man with dark and rigid skin, huge muscles and a bulging tusk in front of him, along with a broken glass of wine. He realized at that moment: &quot;Finally, the mountain god have given me a good companion! Let's go home mate!&quot;

