&ldquo;I know I am no match for him, but these feelings are overflowing out&hellip;!!&rdquo; 
Four girls have fallen in love with boys older than them: the four Odagiri, each one with their own great personality.
To be avoided, to love, and to be loved too much (!?)&hellip; This is the start of four love stories, of four girls who can&rsquo;t hold back their feelings and are making their way to the adult world!

Ginger Torte and Lerajie Atlanta, both noble daughters of marquesses, are lifelong enemies and rivals. When Ginger&rsquo;s fiance, Kishon Mickelson, is stolen by Lerajie, Ginger decides she&rsquo;s had enough!

But one day, Ginger stumbles upon a strange novel - one where Lerajie is the main protagonist, and she is the villainess! She tries her best to ignore it, but when things start playing out just as written in the story, she has no choice but to rely on the novel to change her doomed future as the villainess. 

&ldquo;Exactly what did I do to deserve this fate?! Why did I have to become the villainess?&rdquo;

Enter the mysterious Prince Izana, the male lead of the novel. Confined within the depths of the Templar Tower for years by King Astor, he finally sees the light of day when his father passes away. But according to the novel, he&rsquo;s destined to fall in love with Lerajie, leaving Ginger to wallow in her own misery!

&ldquo;All I ever did was live life as best I could! But as if stealing my fiance wasn&rsquo;t enough, now Lerajie is going to claim the male lead?! No way I&rsquo;ll let that happen!&rdquo;

The &ldquo;villainess&rdquo; Ginger, who now knows Prince Izana&rsquo;s deepest secret (thanks to the novel), attempts to seduce him with -2% cautiousness and 200% cuteness!

As a loyal disciple, Ye Chen dedicated himself to guard the spiritual medicine field for his sect. But, during a fight with enemies, the spiritual field was destroyed. His loyalty and dedicating to the sect could not save him. The loyalty he thought he had obtained from his peers and lover, could not save him from betrayal. Thus, he was shamelessly banished from the sect. With the help of a flame falling from heaven, Ye Chen began to develop himself into a stronger cultivator. Battled against his opponents, unfolded his legendary life and rewrote his own story&hellip;

