Como disc&iacute;pulo leal, Ye Chen se dedicou a guardar o campo da medicina espiritual para sua seita. Mas, durante uma luta com os inimigos, o campo espiritual foi destru&iacute;do. Sua lealdade e dedica&ccedil;&atilde;o &agrave; seita n&atilde;o poderiam salv&aacute;-lo. A lealdade que ele pensava ter obtido de seus colegas e amante n&atilde;o poderia salv&aacute;-lo da trai&ccedil;&atilde;o. Assim, ele foi descaradamente banido da seita. Com a ajuda de uma chama caindo do c&eacute;u, Ye Chen come&ccedil;ou a se tornar um cultivador mais forte. Lutou contra seus oponentes, desenrolou sua vida lend&aacute;ria e reescreveu sua pr&oacute;pria hist&oacute;ria ...

&quot;Tell me, the pain and suffering I've went through... is there an easier way to endure it?&quot;
The tiger, Li Yexun, didn't know how to comfort A'Song.
&quot;There isn't... but you still have me.&quot;

With the rising tide of steam power and machinery, who can come close to being a Beyonder? Shrouded in the fog of history and darkness, who or what is the lurking evil that murmurs into our ears?

Waking up to be faced with a string of mysteries, Zhou Mingrui finds himself reincarnated as Klein Moretti in an alternate Victorian era world where he sees a world filled with machinery, cannons, dreadnoughts, airships, difference machines, as well as Potions, Divination, Hexes, Tarot Cards, Sealed Artifacts&hellip;

The Light continues to shine but mystery has never gone far. Follow Klein as he finds himself entangled with the Churches of the world&mdash;both orthodox and unorthodox&mdash;while he slowly develops newfound powers thanks to the Beyonder potions.

Like the corresponding tarot card, The Fool, which is numbered 0&mdash;a number of unlimited potential&mdash;this is the legend of &quot;The Fool.&quot;

The villainess is getting married to the villain?!

Lilith, a former villainess was killed by the man she loved. She was punished for her evil deeds, but when she woke up, she looked the same as before but was a supporting character in a novel.

&quot;While I'm being abused by my stepmother every day, I'm also engaged to a trashy man?!&quot;

Determined to reflect on her past mistakes and live a good life this time, she enters into a contract marriage with the future villain of the story in order to change his fate and leave her stepmother and two stepsisters behind.

&quot;I do not need love to live a good life!&quot;

~The (now good) life of a former villainess who became the supporting character of a novel~

The gods living in the mountain pick up an abandoned child and name him Will. They poured all their love into raising him, however, when it came to deciding on what he should become, they all had their own vision in mind.

&quot;This child is talented with the sword. Let's make him into a peerless swordsman.&quot;
&quot;No, this child is kind. Let's make him the strongest healer.&quot;
&quot;No, this child is a genius. Let's make him into the ultimate magician.&quot;

To placate them, the chief god comes up with a proposal. &quot;How about he trains in all of them?&quot;

Through the curriculum given to him by the God of the Sword, Goddess of Healing, and the God of Sorcery, Will becomes the strongest and sets out on his journey at 14. 

[hr][b]Italiano[/b]
[Spoiler]Will era un ragazzo abbandonato al suo destino in mezzo al nulla, ma la sua fortuna &egrave; cambiata quando gli dei gli hanno dato un altro destino. Quel bambino che era destinato a morire &egrave; ora destinato a diventare il pi&ugrave; potente di tutti con l'aiuto del dio della spada, il dio della magia e la dea della sanzione, le avventure di Will stanno per iniziare![/Spoiler]

Meridian Sasha is the perfect woman who has the beauty, wealth, and status. She fainted and woke up on a ship in the middle of the ocean, with a wedding dress on.

[i]I got married?[/i]

&quot;Who dares to try and touch Meridian Sasha? I'll make sure that he'll never want to marry me!&quot;

But the one who appears to be her husband is the War Hero of the Empire, Demetrius Kyros who suddenly took out his sword. How can that be a man who wants to get married?

&quot;I was wondering who invited me like this... Will I be able to go back if I kill you?&quot;
&quot;Move. I'm sorry to say but I'm a victim too you know?&quot;

Two people kidnapped to be married. They have no choice, but to live in an island together...

1st goal, escape the island!

Final goal, revenge and divorce!
