In a town with nothing, in the middle of a daily life with seemingly no signs of change, high schooler Reiji Kurose was &quot;just&quot; living. Family, dreams for the future, childhood friends. All of them were binding him down to that city. He thought he would &quot;just&quot; keep on living like that. Until he met her. Is there hope in living? Is there light waiting ahead? It's the start of a boy meets girl series which reflects the &quot;now.&quot;

[b][u]French / Fran&ccedil;ais[/u][/b]
[spoiler]Dans une ville vide, au milieu d'une vie quotidienne r&eacute;p&eacute;titive, Reiji Kurose, lyc&eacute;en, ne faisait que &quot; vivre&quot;. Sa famille, ses r&ecirc;ves d'avenir, ses amis d'enfance. Tous ces &eacute;l&eacute;ments le liaient &agrave; cette ville. Il pensait qu'il continuerait &quot;juste&quot; &agrave; vivre jusqu'&agrave; la fin, jusqu'&agrave; ce qu'il la rencontre. Y a-t-il de l'espoir dans la vie ? Y a-t-il de la lumi&egrave;re dans l'avenir ? C'est le d&eacute;but d'une s&eacute;rie de rencontres entre gar&ccedil;ons et filles qui refl&egrave;te le pr&eacute;sent ![/spoiler]

Scientist Eric Stuart has been kidnapped! To rescue him, Steve McDaniel, an elite soldier, must infiltrate the enemy's fortress, find the kidnapped scientist, and bring him home.

&quot;I'll protect you with my life!&quot;

After hearing such a solemn promise, Eric couldn't help but fall for Steve&hellip;

[b][u]Polish / Polski:[/u][/b]
[spoiler] Naukowiec Eric Stuart został porwany! Aby go uratować, Steve McDaniel, wybitny żołnierz, musi przeniknąć do twierdzy wroga, odnaleźć uprowadzonego naukowca i sprowadzić go z powrotem. Ochronię cię za wszelką cenę! &ndash; usłyszawszy tak uroczystą przysięgę od McDaniela, Eric nic nie m&oacute;gł poradzić na to, że się w nim zakochał...

A rendezvous through the glass window between a young president and a window cleaning worker! Hakuhou Tamaki is the young president of Hakuhou Foods, one of the leading enterprises in Japan. He had given up on things called family due to his father&rsquo;s continued marriages and divorces, and until now thinks that he doesn&rsquo;t need a romantic relationship in his life. However, the moment he met the eyes of the window cleaners Yashiro Jin over the window, his world completely changed!

&ldquo;I want to talk to you who smiles on the other side of the beautifully polished glass.&rdquo;

From that day, Tamaki begins his first-ever romantic approach&hellip;!
